import Head from 'next/head'
import MainLAyout from '../components/Mainlayout'

export default function Home() {
  return (
    <MainLAyout>
      <Head>
        
      </Head>

    <main >
        <div className="homeContainer">
        <h1 className="settingHead rowTop">Clients </h1>
            <div className="table rowTop">
                <table className="table ">
                    <thead>
                        <tr>
                        <th>Id</th>
                        <th>Firstname</th>
                        <th>Lastname</th>
                        <th>Username</th>
                        <th>Рассылка</th>
                        <th>Первое обращение</th>
                        <th>Последнее обращение</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                        <td></td>
                        <td></td>
                        <td></td>
                        <td></td>
                        <td></td>
                        <td></td>
                        <td></td>
                    
                        </tr>
                    </tbody>
                </table>
            </div>
        </div>
    </main>

      

      <style jsx>{`
       
       .rowTop{
        margin-top:20px;
        
    }
       .bookingDetail{
           margin-left:10px;
           padding:30px 10px;
           display:flex;
           width:200px;
           flex-direction:column;
       }
       .bookingLabel{
            margin-left:10px;
            border-bottom:1px solid black;
       }
       .labelText{
           color:blue;   
       }
      

      `}</style>
    </MainLAyout>
  )
}
